import React from "react";

import { Text, Image, View, StyleSheet, ScrollView, Card } from "react-native";

const ItemTemplate = (props) => {
  return (
    <View style={styles.itemTemplate}>
      <Text style={styles.text}>Item Retrieved: </Text>

      <Image
        //{props.img}
        source={{ uri: "https://wallpapercave.com/wp/wp2551790.jpg" }}
        style={{ width: 250, height: 250 }}
      />
      <Text>ID: {props.id}</Text>
      <Text>Name: {props.name}</Text>
      <Text>Price: {props.price} </Text>
      <Text>Quantity: {props.quantity} </Text>
    </View>
  );
};

const styles = StyleSheet.create({
  itemTemplate: {
    flex: 1,
    flexDirection: "column",
    justifyContent: "flex-start",
    alignItems: "center",
    backgroundColor: "#0074cc",
    borderWidth: 5,
    width: 260,
    height: 355,
    borderColor: "#0091ff",
    marginTop: 440,
    marginLeft: 75,
    position: "absolute",
    color: "white",
  },
});

export default ItemTemplate;
